import React from 'react';
import  './App.css';


export default function App(){
    return(
        <>
        <div className="about">
         <CSSAnimation><h3 className='first' data-text="Hello My Name is Mo. Kaif Siddique">Hello My Name is <span style={{color:"wheat"}}>Mo. Kaif Siddique</span></h3>
        <h1>I am Full Stack <span style={{color:"tomato"}}>Web Developer</span> , FrontEnd specialist </h1>
        <h2>Check out my portfolio and projects</h2>
        <h3>If you do like , contact me and let's work together</h3></CSSAnimation>
        
        </div>
        <div className="links">
            
            </div>
        </>
    )
}
